env:
  browser: true
  es2021: true
extends: airbnb-base
overrides: []
parserOptions:
  ecmaVersion: latest
  sourceType: module
rules: {
  no-shadow: 0,
  consistent-return: 0,
  no-undef: 0,
  no-console: 0,
  no-underscore-dangle: [2, { "allow": ["__filename", "__dirname"] }],
  import/extensions: 0,
  import/no-unresolved: 0
}
